import React from "react";
import logo_light from "../assets/logo_light.png";
import logo_dark from "../assets/logo_dark.png";
import versy from "../assets/versy.png";

const Logo = () => {
  return (
    <div className="logo">
      <a href="/">
        <img src={versy} alt="Versy Logo" />
      </a>
    </div>
  );
};

export default Logo;
